import React from "react";
import "../css/Home.css";
import picture1 from "../assets/images/silhouette.jpg";
import picture2 from "../assets/images/hondaRepair.jpg";
import Map from "./Map";
import ParticleBackground from "./ParticleBackground.js";

const Home = () => {
  return (
    <div className="home">
      <ParticleBackground />
      <h1>T-T Honda</h1>
      <p id="since">[Since 2004]</p>
      <h4>Full service car repair - specializing in Japanese cars</h4>
      <div id="phone">
        <a href="tel:+16192840050">(619)284-0050</a>
      </div>
      <p id="address">4030 43rd Street San Diego, CA 92105</p>
      <div className="imageMapImage">
        <img src={picture1} height="200px" width="100px" alt="car on lift" />
        <Map />
        <img src={picture2} height="200px" width="100px" alt="honda repair" />
      </div>
      <p id="slogan">Oil changes to timing belts!</p>
      <div id="hours">
        <h4>Hours</h4>
        <p>Monday to Friday...8:00 to 5:30</p>
        <p>Saturday...9:00 to 3:30</p>
        <p>Closed Sunday</p>
      </div>
    </div>
  );
};

export default Home;
